import "./Footer.css";
import React from "react";
import { Col, Row } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedin } from "@fortawesome/free-brands-svg-icons"

const Footer = ({}) => {
  var d = new Date();
  var year = d.getFullYear();
  return (
    <div className="footer">
      <Row>
        <Col>
          <h4>Connect With Me</h4>
          <a href="https://www.linkedin.com/in/finlay-goff-602779132/" target="_blank">
            <FontAwesomeIcon icon={faLinkedin} className="ml-2" />
          </a>
        </Col>
        <Col>
          <h4>About Me</h4>
        </Col>
        <Col>
          <h4>Navigate</h4>
          <Col></Col>
          <a>Projects Summary</a>
          <a>Education</a>
          <a>Experience</a>
          <a>Skills</a>
          <a>Achievements</a>
          <Col>
            <a>All Projects</a>
          </Col>
        </Col>
      </Row>
      <p className="copyright">&copy; {year} Finlay Goff. All rights reserved.</p>
    </div>
  );
};


export default Footer;
